import React, { Component } from 'react';
import './skills.css';

class Skills extends Component {

  render() {
    return (
    	<React.Fragment>
            <h1 style={{textAlign:'center'}}>MY SKILLS</h1>
    		<div className="myProgress" style={{top:250,left:100}}>
                <div className="myBar">80%</div>
            </div>
            <div className="myProgress" style={{top:350,left:100}}>
                <div className="myBar">80%</div>
            </div>
            <div className="myProgress" style={{top:450,left:100}}>
                <div className="myBar">80%</div>
            </div>
            <div className="myProgress" style={{top:250,left:700}}>
                <div className="myBar">80%</div>
            </div>
            <div className="myProgress" style={{top:350}}>
                <div className="myBar">80%</div>
            </div>
            <div className="myProgress" style={{top:450}}>
                <div className="myBar">80%</div>
            </div>

    	</React.Fragment >
    );
  }
}

export default Skills;
